@RStudio features that have changed the way I work with #RStats:

1. CTRL + SHIFT + P
Opens the command palette, from which you can search for any RStudio command or setting. Want to know if RStudio can do a word count? No problem, just open the command palette and type "word".

@RStudio features that have changed the way I work with #RStats:

2. CTRL + Click
If you hold the CTRL key and click on the name of a file or function in a script, RStudio will open the file or jump to the function, wherever that might be found in your project.

@RStudio features that have changed the way I work with #RStats:

3. CTRL + .
This is a cross between 1 and 2: Hold CTRL and press "." to open a popup box from which you can search for any file or function in your project.

